import { React } from 'react';

export const MatchDetailCard = ({match}) => {
  return (
    <div className="MatchDetailCard">
        <h1> Latest Match </h1>
        <h4> Match Details </h4>
        <h4> {match.team1} vs {match.team2} </h4>
    </div>
  );
}
